LUE_ID";s:8:"23286:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:2563:"Ровно год назад, в апреле, выйдя после первой консультации у Эльвиры Валентиновны, я почему- то загадала: &quot;Через год обязательно будет малыш&quot;. И это несмотря на то, что доктор сказала, что все очень сложно у нас с мужем, что надо настраиваться на длительное лечение, что может понадобиться несколько попыток прежде, чем у нас будет ребенок... Нам повезло с первой. И слово &quot;повезло&quot; здесь уместно только потому, что повезло с выбором клиники. Все наше счастливое семейство от всего сердца благодарит наших чудесных докторов, прежде всего- Эльвиру Валентиновну, которая помогла нам подготовиться к зачатию и безупречно провела всю процедуру от начала стимуляции до последнего УЗИ, когда мы увидели биение малюсенького сердечка. Доктор всегда была на связи, замечательно все разъясняла и поддерживала в минуты слабости и нервозности. Потом нам очень помог Громыко Юрий Леонидович, который всегда, при малейшей проблеме протягивал руку помощи, &quot;дотянув&quot; нас до благополучно закончившихся родов. Очень хочется поблагодарить доктора Корсака, который организовал такую потрясающую клинику, в которой весь персонал борется с тобой за победу и искренне помогает и радуется, если у тебя получается! Спасибо всем- всем- всем за помощь, всем сестричкам, девушкам на ресепшене, кассирам, уборщицам, все были очень вежливы и добры с нами. И... очень хочется поскорее вернуться за еще одним малышом:)) Мария	";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23286:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23286:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23286:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23286:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23286:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PRO